(function (Scratch) {
  "use strict";

  if (!Scratch.extensions.unsandboxed) {
    throw new Error("Newgrounds Audio must run unsandboxed");
  }

  const menuIconURI =
"data:image/svg+xml;base64,";

  const blockIconURI =
"data:image/svg+xml;base64,";

  let response = "";

  class SPaudioNG {
    getInfo() {
      return {
        id: "SPaudioNG",
        name: "Newgrounds Audio",
        color1: "#EB7522",
        menuIconURI,
        blockIconURI,
        blocks: [
          {
            func: "warn",
            blockType: Scratch.BlockType.BUTTON,
            text: "Block Warning",
          },
          {
            opcode: "fetchID",
            blockType: Scratch.BlockType.COMMAND,
            text: "fetch Track data with ID [ID]",
            arguments: {
              ID: {
                type: Scratch.ArgumentType.NUMBER,
                defaultValue: 505816,
              },
            }
          },
          {
            opcode: "findURL",
            blockType: Scratch.BlockType.REPORTER,
            text: "get Track URL",
            disableMonitor: true,
          },
          {
            opcode: "getTrackInfo",
            blockType: Scratch.BlockType.REPORTER,
            text: "get [INFO] from Track",
            arguments: {
              INFO: {
                type: Scratch.ArgumentType.NUMBER,
                menu: "INFO",
                defaultValue: "Name",
              },
            }
          },
        ],
        menus: {
          INFO: {
            acceptReporters: true,
            items: [
              "Name",
              "Author",
              "Description",
              "Rating",
              "Release Date",
              "File Size",
              "Length",
              "Listens",
              "Downloads",
              "Vote Count"
            ]
          }
        }
      };
    }

    warn() {
      let popup = [
        "This is just an Experimental Block that is in grey Legal grounds. Be careful of how you use it.",
      ];
      if (confirm(popup.join("\n\n"))) {
      }
    }

    fetchID(args) {
      const url = `https://corsproxy.io/?https://www.newgrounds.com/audio/listen/${args.ID}`;
      return fetch(url)
        .then(response => {
          if (!response.ok) {
            throw new Error("Error 404");
          }
          return response.text();
        })
        .then(html => {
          response = html;
        })
        .catch(error => {
          console.error("Error:", error);
        });
    }

    getDescriptionText(element) {
      let descriptionText = "";
      let currentNode = element;
      while (currentNode) {
        if (currentNode.nodeName === "P" || currentNode.nodeName === "#text") {
          descriptionText += currentNode.textContent;
        }
        if (currentNode.nodeName === "SCRIPT") {
          break;
        }
        currentNode = currentNode.nextSibling;
      }
      return descriptionText.trim();
    }

    findURL(args) {
      const html = response;
      if (html === "") {
        return "Fetch an ID First!"
      }
      const embedControllerMatch = html.match(/new embedController\(\[{"url":"([^"]+)\?/);
      let url = embedControllerMatch[1];
      url = "https://api.codetabs.com/v1/proxy?quest=" + url.replaceAll("\\", "");
      return url;
    }

    getTrackInfo(args) {
      const html = response;
      if (html === "") {
        return "Fetch an ID First!"
      }
      const parser = new DOMParser();
      const doc = parser.parseFromString(html, "text/html");
      const scriptTags = doc.querySelectorAll("script");
      let scriptContent = null;

      scriptTags.forEach(scriptTag => {
        if (scriptTag.textContent.includes("var embed_controller = new embedController([")) {
          scriptContent = scriptTag.textContent;
        }
      });

      const artistMatch = scriptContent.match(/"artist":"([^"]+)"/);
      const lengthMatch = scriptContent.match(/"length":"([^"]+)"/);
      const fileSizeMatch = scriptContent.match(/"filesize":(\d+)/);
      const info = {};

      switch (args.INFO) {
        case "Name":
          const nameElement = doc.querySelector("meta[property=\"og:title\"]");
          info["Name"] = nameElement ? nameElement.getAttribute("content") : "";
          break;
        case "Author":
          info["Author"] = artistMatch[1];
          break;
        case "Description":
          let descriptionElement = doc.querySelector(".pod-body#author_comments p");
          if (!descriptionElement) {
            descriptionElement = doc.querySelector(".pod-body #author_comments");
          }
          info["Description"] = descriptionElement ? this.getDescriptionText(descriptionElement) : "";
          break;
        case "Rating":
          const ratingMetaElement = doc.querySelector("meta[itemprop=\"ratingValue\"]");
          info["Rating"] = ratingMetaElement ? ratingMetaElement.getAttribute("content") / 2 : "";
          break;
        case "Release Date":
          const releaseDateElement = doc.querySelector("meta[itemprop=\"datePublished\"]");
          info["Release Date"] = releaseDateElement ? releaseDateElement.getAttribute("content") : "";
          break;
        case "File Size":
          const fileSizeBytes = parseInt(fileSizeMatch[1], 10);
          const fileSizeMB = (fileSizeBytes / (1024 * 1024)).toFixed(2);
          info["File Size"] = `${fileSizeMB} MB`;
          break;
        case "Length":
          info["Length"] = lengthMatch[1];
          break;
        case "Listens":
          const dtElements = doc.querySelectorAll('dt');
          for (const dt of dtElements) {
            if (dt.textContent.trim() === "Listens") {
              const listensDd = dt.nextElementSibling;
              info["Listens"] = listensDd.textContent.trim();
              break;
            }
          }
          break;
        case "Downloads":
          const dlElements = doc.querySelectorAll('dt');
          for (const dt of dlElements) {
            if (dt.textContent.trim() === "Downloads") {
              const dlDd = dt.nextElementSibling;
              info["Downloads"] = dlDd.textContent.trim();
              break;
            }
          }
          break;
        case "Vote Count":
          const voteElements = doc.querySelectorAll('dt');
          for (const dt of voteElements) {
            if (dt.textContent.trim() === "Votes") {
              const votesDd = dt.nextElementSibling;
              info["Vote Count"] = votesDd.textContent.trim();
              break;
            }
          }
          break;
        default:
          return "Invalid Menu Selection";
      }
      return info[args.INFO];
    }
  }

  Scratch.extensions.register(new SPaudioNG());
})(Scratch);